let generateHourSlots = function(totColCt = fondue.SprintSlotCount){
    let dynamicallyCreatedColumns = [], dispColOutput = [], hidColOutput = [];
    let remOP=[], delOP=[], ideOP=[], dayOP=[];
    for(var j=0; j<+fondue.SprintSlotCount; j++){
        remOP.push({title: 'REMAIN' + j, field:'remaining-' + j, bottomCalc:"sum", bottomCalcFormatter:totalToHours, bottomCalcFormatterParams:{slot:j, type:'rem'}, hozAlign:'right', formatter:hourColumnFormatter, formatterParams:{slot:j}, visible:false});
        delOP.push({title: 'DELTA' + j, field:'delta-' + j, bottomCalc:"sum", bottomCalcFormatter:totalToHours, bottomCalcFormatterParams:{slot:j, type:'del'}, hozAlign:'right', formatter:hourColumnFormatter, formatterParams:{slot:j}, visible:false});
        ideOP.push({title: 'IDEAL' + j, field:'ideal-' + j, bottomCalc:"sum", bottomCalcFormatter:totalToHours, bottomCalcFormatterParams:{slot:j, type:'ide'}, hozAlign:'right', formatter:hourColumnFormatter, formatterParams:{slot:j}, visible:false});
        dayOP.push({title: 'DAY ' + j, titleFormatter:dayHeaderFormatter, titleFormatterParams:{slot:j}, field:'remaining-' + j, bottomCalc:"sum", bottomCalcFormatter:totalFormatter, bottomCalcFormatterParams:{slot:j, key:''}, hozAlign:'right', formatter:dayFormatter, formatterParams:{slot:j}, visible:true});
    }
    return [...remOP,...delOP,...ideOP, ...dayOP];
}

let titleText = function(value, forcePlainText=value) {
    return `<p title="${forcePlainText}">${value}</p>`; 
}

let hoverReader = function(cell, formatterParams) {
    var value = (typeof(cell) !== 'string') ? cell.getValue() : cell;
    return titleText(value);
}

let findSiblingCell = function(cell, field){
    return cell.getRow().getCell(field) || null;
}

let findSiblingCellValue = function(cell, field){
    let sibCell = findSiblingCell(cell, field);
    return (sibCell != null) ? sibCell.getValue() : null;
}

